INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`) VALUES
(1, 'wc-admin-welcome-note', 'info', 'en_US', 'Nueva(s) caracterstica(s)', 'Bienvenido a la nueva experiencia de WooCommerce! En esta nueva versin podrs echar un vistazo a cmo funciona tu tienda en el escritorio, gestionar aspectos importantes de tu negocio, (como la gestin de pedidos, inventario, valoraciones) desde cualquier parte de la interfaz, navegar en los datos de tu tienda con una completamente nueva seccin de anlisis y ms!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2019-11-14 16:33:23', NULL, 0),
(2, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Conectar con WooCommerce.com', 'Conctate para recibir avisos y actualizaciones importantes de productos.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2019-11-14 16:33:24', NULL, 0),
(3, 'wc-admin-store-notice-giving-feedback', 'info', 'en_US', 'Valora tu experiencia', 'Si te gusta WooCommerce Admin, por favor, djanos una valoracin de 5 estrellas. Muchas gracias por adelantado!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2019-11-18 14:25:26', NULL, 0),
(4, 'wc-admin-mobile-app', 'info', 'en_US', 'Instala la aplicacin mvil WooCommerce', 'Instala la aplicacin mvil de WooCommerce para gestionar pedidos, recibir avisos de ventas y ver mtricas clave all donde ests.', 'phone', '{}', 'unactioned', 'woocommerce-admin', '2019-11-18 14:25:26', NULL, 0),
(5, 'wc-admin-facebook-extension', 'info', 'en_US', 'Vende en Facebook', 'Haz crecer tu negocio dirigindote a las personas adecuadas e impulsando las ventas con Facebook. Puedes instalar ahora esta extensin gratuita.', 'thumbs-up', '{}', 'unactioned', 'woocommerce-admin', '2019-12-11 13:51:10', NULL, 0);
